window.bookSummaryJSON = "<p>Pulled into another world after his death, Kirin now has to live a life full of things unknown to him. His knowledge as a tycoon seemed worthless, and the struggle to survive became apparent; but with the leveling system backing him up, he aims to live a life that is as modest as possible.</p> <p>“Friends? I had none of that back then...let’s make some now! I am strong enough...right?” “Money? I am tired of those.... Eh? The system actually provides me after finishing a quest? Now that’s what I’d call convenience!”</p> <p>Follow the story of our former tycoon as he lives a modest life (or at least tries to) in a fantasy world!</p> <p><b>Tycoon is a LitRPG series.</b></p>"; 
